import "../assets/scss/_kanban.scss";
import KanbanColumn from "./KanbanColumn";

const Kanban = () => {
  return (
    <div className="kanban">
      <KanbanColumn id="open" tasks={["Task 1", "Task 2", "Task 3"]} />
      <KanbanColumn id="ongoing" tasks={["Task 4", "Task 5", "Task 6"]} />
      <KanbanColumn id="close" tasks={["Task 7", "Task 8", "Task 9"]} />
    </div>
  );
};

export default Kanban;
